hlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1897230","type":"CustomJS"},{"attributes":{"source":{"id":"1896981"}},"id":"1896986","type":"CDSView"},{"attributes":{},"id":"1897042","type":"BasicTicker"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"1896930"}],"tooltips":[["Date","@datetime{%c}"],["Equity","@equity{+0,0.[000]%}"]]},"id":"1896932","type":"HoverTool"},{"attributes":{},"id":"1896908","type":"ResetTool"},{"attributes":{},"id":"1896950","type":"Selection"},{"attributes":{"coordinates":null,"group":null,"line_color":"#666666","line_dash":[6],"location":0},"id":"1897065","type":"Span"},{"attributes":{"source":{"id":"1896919"}},"id":"1896925","type":"CDSView"},{"attributes":{},"id":"1897188","type":"BasicTicker"},{"attributes":{"data":{"Close":{"__ndarray__":"hetRuB6FVUDhehSuR/FUQOF6FK5HQVVAmpmZmZmJVUBSuB6F62FVQOxRuB6Fa1VAXI/C9Sg8VUAK16NwPWpVQBSuR+F69FVAKVyPwvUoVkDNzMzMzBxWQFyPwvUorFVAzczMzMycVUCamZmZmTlVQClcj8L1OFVAexSuR+GaVUD2KFyPwtVVQAAAAAAAgFVAhetRuB7FVUCuR+F6FL5VQPYoXI/CxVVAuB6F61H4VEBI4XoUrudUQOF6FK5H0VRArkfhehTuVEAK16NwPYpVQGZmZmZmllVArkfhehTOVUB7FK5H4ZpVQD0K16NwvVVAMzMzMzPjVUDhehSuR+FVQHsUrkfhOlZAj8L1KFzfVUAK16NwPUpWQJqZmZmZSVdAhetRuB41V0A9CtejcI1XQI/C9Shcb1dAw/UoXI9yV0AUrkfherRXQJqZmZmZuVdA4XoUrkfhV0AUrkfheiR
